CREATE TABLE `sales_log` (
  `id` INTEGER(11) NOT NULL AUTO_INCREMENT,
  `customer_id` INTEGER(8) NOT NULL,
  `shelf_id` TINYINT(4) DEFAULT NULL,
  `register_id` INTEGER(6) DEFAULT NULL,
  `payment_method_id` TINYINT(2) DEFAULT NULL,
  `order_type_id` TINYINT(2) DEFAULT NULL,
  `order_date` DATETIME DEFAULT NULL,
  `order_amt` DECIMAL(8,2) DEFAULT NULL,
  `items_qty` INTEGER(8) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
)ENGINE=InnoDB
AUTO_INCREMENT=401 AVG_ROW_LENGTH=98 CHARACTER SET 'latin1' COLLATE 'latin1_swedish_ci';
COMMIT;



